import React, { Component } from "react";
import Prism from "prismjs";
import { Grid, Paper, withStyles, List } from "@material-ui/core";

import "../ReactJs/styles.css";
import Sidebar from "./sidebar";
import PrismCode from "../ReactJs/prismCode";

import Browser from "../../assets/css1.PNG";
import boxModels from "../../assets/boxings.png";

const titles = { backgroundColor: "#F0F8FF", padding: "1px", fontSize: "16px" };

const styles = (theme) => ({
  paper: {
    margin: theme.spacing(1),
    padding: theme.spacing(1),
  },
  smMargin: {
    margin: theme.spacing(1),
  },
  actionDiv: {
    textAlign: "center",
  },
});

const flextFloat = ``.trim();






const responsivecss = `
<img src="example-image.jpg" alt="Example Image" style="max-width: 100%; height: auto;">
`.trim();

const responsivecss2 = `
<img srcset="example-image-480w.jpg 480w,
             example-image-768w.jpg 768w,
             example-image-1024w.jpg 1024w"
     sizes="(max-width: 768px) 100vw,
            768px"
     src="example-image-768w.jpg" alt="Example Image">
`.trim();

const boxShadow = `
.box {
  width: 200px;
  height: 200px;
  background-color: #eee;
  box-shadow: 2px 2px 2px rgba(0, 0, 0, 0.5);
}
`.trim();

class CssCodes extends Component {
  componentDidMount() {
    setTimeout(() => Prism.highlightAll(), 0);
  }
  render() {
    const { classes } = this.props;
    return (
      <Grid container>
        <Grid item xs={2}>
          <Paper className={classes.paper}>
            <h4>
              <Sidebar />
            </h4>
          </Paper>
        </Grid>
        <Grid item xs={10}>
          <Paper className={classes.paper}>
            <List></List>
          </Paper>
        </Grid>
      </Grid>
    );
  }
}

export default withStyles(styles)(CssCodes);
